PROBLEM: 'Regular octagon '$ABCDEFGH$' has area '$n$'. Let '$m$' be the area of quadrilateral '$ACEG$'. What is '$\tfrac{m}{n}?$'\n'
=======
CHOICES:
[A]: \frac{\sqrt{2}}{4}
[B]: \frac{\sqrt{2}}{2}
[C]: \frac{3}{4}
[D]: \frac{3\sqrt{2}}{5}
[E]: \frac{2\sqrt{2}}{3}

PROBLEM: 'In the complex plane, let '$A$' be the set of solutions to '$z^{3}-8=0$' and let '$B$' be the set of solutions to '$z^{3}-8z^{2}-8z+64=0.$' What is the greatest distance between a point of '$A$' and a point of '$B?$'\n'
=======
CHOICES:
[A]: 2\sqrt{3}
[B]: 6
[C]: 9
[D]: 2\sqrt{21}
[E]: 9+\sqrt{3}

PROBLEM: 'Jason rolls three fair standard six-sided dice. Then he looks at the rolls and chooses a subset of the dice (possibly empty, possibly all three dice) to reroll. After rerolling, he wins if and only if the sum of the numbers face up on the three dice is exactly '$7.$' Jason always plays to optimize his chances of winning. What is the probability that he chooses to reroll exactly two of the dice?\n'
=======
CHOICES:
[A]: \frac{7}{36}
[B]: \frac{5}{24}
[C]: \frac{2}{9}
[D]: \frac{17}{72}
[E]: \frac{1}{4}

PROBLEM: 'Suppose that '$\triangle{ABC}$' is an equilateral triangle of side length '$s$', with the property that there is a unique point '$P$' inside the triangle such that '$AP=1$', '$BP=\sqrt{3}$', and '$CP=2$'. What is '$s$'?\n'
=======
CHOICES:
[A]: 1+\sqrt{2}
[B]: \sqrt{7}
[C]: \frac{8}{3}
[D]: \sqrt{5+\sqrt{5}}
[E]: 2\sqrt{2}
